  long delta = upload.getProgress().getBytesTransferred() -
      lastBytesTransferred;
  if (delta > 0) {
    LOG.debug("S3A write delta changed after finished: {} bytes", delta);
    fs.incrementPutProgressStatistics(key, delta);
  }
  return delta;
